import React, { useState, useEffect } from 'react'
import { Container, Button, Row, Col } from "react-bootstrap"
import { useDispatch, useSelector } from "react-redux"
import Workout from "../components/Workout"
import { LinkContainer } from 'react-router-bootstrap'
import { listWorkouts } from '../actions/workoutActions'
import Loader from "../components/Loader"
import Message from "../components/Message"


const CalanderScreen = () => {
    const dispatch = useDispatch()

    const [date, setDate] = useState(null)

    const workoutList = useSelector((state) => state.workoutList)
    const { loading, error, workouts } = workoutList
    

    useEffect(() => {
       dispatch(listWorkouts())
    }, [dispatch])

    return (
        <>
            <Row>
                <Col md={6}>
                    <div>
                        Here will be the Calander
                    </div>
                </Col>
                <Col md={6}>
                    {loading && <Loader />}
                    {error && <Message variant="danger">{error}</Message>}
                    <Container className='mt-5'>
                        <h1 className='mb-5'>All Available Workouts</h1>
                        {workouts && workouts.map(workout => (
                            <Workout workout={workout} />
                        ))}
                    </Container>
                </Col>
            </Row>
        </>
    )
}

export default CalanderScreen
